/** Add a data point. */
public void addData(TimeData td) {
  td.recordMemUsage();
  Vector v = (Vector) data.get(td.name);
  if (v == null) {
    v = new Vector();
    data.put(td.name, v);
  }
  v.add(td.clone());
}

